from collections import Counter

class Solution:
    def maxSubstringLength(self, s: str, kk: int) -> bool:
        c = Counter(s)
        lss =[]
        visit ={}
        ret = 0
        n = len(s)
        for a in s:
            if a not in visit:
                visit[a] = 1
                lss.append(defaultdict(int))
            for ls in lss:
                ls[a] +=1
            for ls in lss:
                isG = True
                for k in ls.keys():
                    if ls[k] != c[k]:
                        isG = False
                        break
                if isG == True and sum(ls.values()) !=n:
                    ret +=1
                    lss =[]
                    break
            #print(lss,a,ret)
        #print(ret)
        return ret >=kk



